import React from 'react';
import '../App.css';

class Sample extends React.Component {
  constructor(props) {
    super(props);
  }

  showAlert = () => {
    alert('hi');
  }

  render() {
    return (
      <div>
        <h1>Hello World</h1>
        <button onClick={this.showAlert} >
          Say Hi!
        </button>
      </div>
    );
  }
}

export default Sample;
